import React from 'react';
import { Link } from 'react-router-dom';

function MvchoPage() {
  return (
    <div>
      <h1>영화 선택 페이지</h1>
      {/* 메인 추천 페이지로 이동하는 버튼 */}
      <Link to="/recommendations"><button>영화추천받기</button></Link>
      {/* 마이페이지(이미 본 영화)로 이동하는 버튼 */}
      <Link to="/my/watched"><button>마이페이지</button></Link>
    </div>
  );
}

export default MvchoPage;
